('node', 'product', 0, 6, 6, 'und', 0, '<b>Hàng chính hãng nguyên seal, mới 100%</b>\r\nMàn hình IPS, 6.1\", HD+\r\nRAM: 2GB\r\nROM: 16GB\r\nCamera sau: Chính 13MP và Phụ 2MP\r\nCamera trước: 5MP\r\nDung lượng pin: 4000mAh, công nghệ tiết kiệm pin\r\nThẻ SIM: 2 Nano SIM\r\nMở khóa bằng nhận diện khuôn mặt', '', 'full_html'),
('node', 'product', 0, 7, 7, 'und', 0, '<b>Chính hãng, nguyên seal, mới 100%, chưa Active</b>\r\nMiễn phí giao hàng toàn quốc\r\nThiết kế: Nguyên khối, mặt kính cong 2.5D\r\nMàn hình: 5.5 inch, Full HD (1080 x 1920 pixels)\r\nCamera Trước/Sau: 5MP/ 12MP\r\nCPU: Apple A9 2 nhân 64-bit\r\nBộ nhớ: 32GB\r\nRAM: 2GB\r\nTính năng: Mở khóa bằng vân tay', '', 'full_html'),
('node', 'product', 0, 9, 9, 'und', 0, 'Màn hình:	IPS LCD, 6.3\", Full HD+\r\nHệ điều hành:	Android 9.0 (Pie)\r\nCamera sau:	Chính 48 MP & Phụ 5 MP\r\nCamera trước:	13 MP\r\nCPU:	Qualcomm Snapdragon 660 8 nhân\r\nRAM:	4 GB\r\nBộ nhớ trong:	64 GB\r\nThẻ nhớ:	MicroSD, hỗ trợ tối đa 256 GB\r\nThẻ SIM:\r\n2 SIM Nano (SIM 2 chung khe thẻ nhớ), Hỗ trợ 4G', '', 'full_html'),
('node', 'page', 0, 10, 10, 'und', 0, 'this is my first project use drupal to built a website, probably it\'s simply and not nice but hope you encourage me to attempt to learn drupal\r\nmy mobile phone: 12345678910112\r\nmy address: street A city B Viet Nam\r\nmy facebook: giangabcd\r\nmy twitter: giangabcd\r\nmy email: giang@gmail.com', '', 'filtered_html'),
('node', 'product', 0, 11, 11, 'und', 0, '<b>Apple iPhone Xs 256GB Vàng kim (Hàng nhập khẩu)</b>\r\n- Màn hình Retina đặc trưng tai thỏ kế thừa từ dòng X\r\n- Thiết kế tràn màn hình cho cảm giác trải nghiệm tuyệt vời\r\n- Chế độ hiển thị HDR sắc nét, màu đen thực\r\n- Sử dụng vật liệu đặc biệt với mặt kính cường lực sáng bóng, thép không gỉ bền bỉ\r\n- Chuẩn chống nước và chống bụi hoàn toàn mới\r\n- Face ID nhanh nhạy hơn\r\n- Tốc độ mượt mà sâu nhờ con chip thông minh A12 Bionic \r\n- Hệ thống camera kép 12MP với cảm biến kết hợp ISP và Neural Engine', '', 'filtered_html'),
('node', 'product', 0, 12, 12, 'und', 0, '<b>Chính hãng, Nguyên seal, Mới 100%, Chưa Active</b>\r\nMiễn phí giao hàng toàn quốc\r\nThiết kế: Nguyên khối\r\nMàn hình: LED-backlit IPS LCD, 5.5 inch Full HD\r\nCamera Trước/Sau: 7MP/ 2 camera 12MP\r\nCPU: Apple A11 Bionic 6 nhân\r\nBộ Nhớ: 64GB\r\nRAM: 3GB\r\nSIM: 1 Nano SIM\r\nTính năng: Chống nước, chống bụi, 3D touch', '', 'full_html'),
