('node', 'product', 0, 14, 14, 'und', 0, '<b>sản phẩm nguyên seal</b>\r\nMàn hình: IPS LCD6.21\", Full HD+\r\nHệ điều hành: Android 8.1\r\nCamera sau: 2 camera 12 MP + 12MP\r\nCamera trước: 20MP\r\nCPU: Snadragon 845\r\nRAM: 6 GB\r\nBộ nhớ trong: 128GB\r\nThẻ SIM: 2 sim\r\nDung lượng pin: 3000mAh\r\nNgôn ngữ : Tiếng anh , tiếng trung', '', 'filtered_html'),
('node', 'product', 0, 16, 16, 'und', 0, '<b>Chính hãng, nguyên seal, mới 100%, chưa active</b>\r\nMiễn phí giao hàng toàn quốc\r\nThiết kế nguyên khối kim loại\r\nMàn hình: 6.23 inch\r\nCamera Trước/Sau: 16MP/25MP\r\nCPU: MediaTek P60\r\nBộ Nhớ: 64GB\r\nRAM: 4GB\r\nSIM: 2 Nano SIM\r\nTính năng: Mở khóa bằng khuôn mặt, mở khóa bằng vân tay', '', 'full_html');
